import React from 'react';

export function App(){
    console.log("hello everyone");
}

export class Aster extends React.Component {
    constructor(){
      super();
      this.fnGetData=this.fnGetData.bind(this);
      this.nameRef=React.createRef();
    }
    fnGetData(){
      let nameRef=this.nameRef.current;
      let name=nameRef.value;
      alert(name);
    }
    render() {
      return <div>
           Name: <input ref="name" />
           <input type='button' value="submit" onClick={this.fnGetData} />
        </div>
    }
  }
 
  export default App;
